/**
 * Community
 * 
 * Community is a high-level concept that defines an online community and what it consists of.
 *
 * http://rdfs.org/sioc/ns#Community
 */
export const Community: OwlClass = 'http://rdfs.org/sioc/ns#Community';

/**
 * Container
 * 
 * An area in which content Items are contained.
 *
 * http://rdfs.org/sioc/ns#Container
 */
export const Container: OwlClass = 'http://rdfs.org/sioc/ns#Container';

/**
 * Forum
 * 
 * A discussion area on which Posts or entries are made.
 *
 * http://rdfs.org/sioc/ns#Forum
 */
export const Forum: OwlClass = 'http://rdfs.org/sioc/ns#Forum';

/**
 * Item
 * 
 * An Item is something which can be in a Container.
 *
 * http://rdfs.org/sioc/ns#Item
 */
export const Item: OwlClass = 'http://rdfs.org/sioc/ns#Item';

/**
 * Post
 * 
 * An article or message that can be posted to a Forum.
 *
 * http://rdfs.org/sioc/ns#Post
 */
export const Post: OwlClass = 'http://rdfs.org/sioc/ns#Post';

/**
 * Role
 * 
 * A Role is a function of a UserAccount within a scope of a particular Forum, Site, etc.
 *
 * http://rdfs.org/sioc/ns#Role
 */
export const Role: OwlClass = 'http://rdfs.org/sioc/ns#Role';

/**
 * Space
 * 
 * A Space is a place where data resides, e.g. on a website, desktop, fileshare, etc.
 *
 * http://rdfs.org/sioc/ns#Space
 */
